		switch(settings.dicebar.direction){
		       case "right":
		           direction = "row";
				   classList +=" horizontal";
		       break;
			   case "left":
			        direction = "row-reverse";
					classList +=" horizontal";
		      break;
			  case "up":
		             direction = "column-reverse";
					 classList +=" vertical";
			   break;
			   case "down":
			          direction = "column";
					  classList +=" vertical";
			    break;
		       default: 
		           direction = "row";
				   classList +=" horizontal";
		       break;
		   }

		if(settings.dicebar.position_type)
			barPosition = settings.dicebar.position_type;
		
