		/**
		 * The currently displayed set of macros
		 * @type {Array}
		 */
		this.dice = [];
		/**
		 * Track collapsed state
		 * @type {boolean}
		 */
		this._collapsed = false;
		/**
		 * Track which hotbar slot is the current hover target, if any
		 * @type {number|null}
		 */
		this._hover = null;

